import React, {useState, useEffect} from 'react';

function Firstresult({firstProfile}) {
    const [loading, setLoading] = useState(true);
    setLoading(false)
    if (loading) {
        return (
        <h1> loading</h1>
        )
      }else{
          return (
        <div>
            <h1> {firstProfile.rating}</h1>
        </div>
    );
     }
}

export default Firstresult;
